  type: Number,
  required: true,
  trim: true,
  maxlength: 4,
},
Age: {
  type: Number,
  required: true,
  maxlength: 2,
},
Email: {
  type: String,
  trim: true,
  required: true,
  unique: true,
},
Faculty: {
  type: ObjectId,
  ref: &quot;Faculty&quot;,
  required: true,
},
pass: {
  type: Number,
  default: 0,
}
</code></pre>
<p>I am saving the student with the help of form like this</p>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>exports.addStudent = (req, res) =&gt; {
  let form = new formidable.IncomingForm();
  form.keepExtensions = true;

  form.parse(req, (err, fields) =&gt; {
    if (err) {
      res.status(400).json({
        error: "problem with feilds",
      });
    }

    // destructuring feilds
    const {
      Fullname,
      AdmissionNumber,
      RollNumber,
      Age,
      Email,
      Faculty,
    } = fields;

    if (
      !Fullname ||
      !AdmissionNumber ||
      !RollNumber ||
      !Age ||
      !Email ||
      !Faculty
    ) {
      return res.status(400).json({
        error: "Please fill all fields",
      });
    }

    //   TODO: restriction on fields
    let student = new Student(fields);

    student.save((err, student) =&gt; {
      if (err) {
        res.status(400).json({
          error: "Saving Student in DB failed",
        });
        console.log(err);
      }
      res.json(student);
      //   console.log(student.gender);
    });
  });
};</code></pre>
</div>
</div>
</p>
