Mongodb Aggregate - Get sent and received message<p>I'm building a simple chat functionality for my app. I'm having a little problem getting sent and received messages.</p>
<p>This my Message Schema:</p>
<pre><code>const MessageSchema = new mongoose.Schema({
    from: {
        type: mongoose.Schema.Types.ObjectId,
        ref: 'User',
        required: true
    },
    to: {
        type: mongoose.Schema.Types.ObjectId,
        ref: 'User',
        required: true
    },
    text: {
        type: String,
        required: true
    },
    seen: {
        type: Boolean,
        default: false
    },
    createdAt: {
        type: Date,
        required: true
    }
});
</code></pre>
<p>Supposed I have this Message documents:</p>
<pre><code>[
  {
    from: &quot;5fef2536ad845e385c34a22f&quot;,  // My Own ID
    to: &quot;5fef2575ad845e385c34a232&quot;   // Example user &quot;John&quot;,
    text: &quot;I sent this&quot;
    ...
  }, 
  {
    from: &quot;5fffdc903eaf522cb8d20994&quot;,  // Example user &quot;Dave&quot;
    to: &quot;5fef2536ad845e385c34a22f&quot;   // My Own ID,
    text: &quot;Dave sent this&quot;
    ...
  }
]
</code></pre>
<p>This is my take to getting sent and received messages</p>
<pre><code>await Message.aggregate([
  {
    $match: {
      $or: [ { from: req.user._id },{ to: req.user._id }]
    }
  },
  { $sort: { createdAt: -1 } },
  {
    $group: {
      _id: '$to',
      from: { $first: '$from' },
      text: { $first: '$text' } 
     ...
    }
  },
  {
    $project: { 
      _id: 0,
      to: '$_id',
      from: 1,
      text: 1
    } 
  }
])
</code></pre>
<p>The above aggregation yields to:</p>
<pre><code>[ 
  // This is the message I sent
  {
    from: &quot;5fef2536ad845e385c34a22f&quot;,
    to: &quot;5fef2575ad845e385c34a232&quot;,
    text: &quot;I sent this&quot;
    ...
  }

  ...
  // I CAN'T FETCH RECEIVED MESSAGES
]
</code></pre>
<p>I am able to get the last <strong>Message that I sent</strong> since I only grouped them with <code>to</code> which messages I only sent. I can't think of a way how I can simultaneously fetch both sent and received messages by grouping them separately.</p>
<p>Should I change the way I model my Message? I would be grateful if you could help me.</p>

