How to insert a new data in mongoDB using worker thread in nodejs<p>I want to insert data into the mongoDB using <code>worker thread</code></p>
<p>Right now I have a worker file, whole purpose of worker file is to save the data into the mongoDB and mainjs is sending the name of the agent that I want to save into the mongoDB</p>
<p><strong>worker.js</strong></p>
<pre><code>const { workerData, parentPort } = require('worker_threads')
const Agent = require('../models/agent')


console.log(&quot;Worker thread is running like a hell: &quot;,  workerData)


    const processRecord =  async () =&gt; {

       const agent = new Agent({agent:workerData})

        try {
            await agent.save()
        }catch(e) {
            console.log(e)
        }
    }

    processRecord();
</code></pre>
<p><strong>main.js</strong></p>
<pre><code>const express = require('express')
const router = new express.Router()
const { Worker } = require('worker_threads')

router.post('/agent', async (req, res) =&gt; {        
    function runService(workerData) {
        return new Promise((resolve, reject) =&gt; {
          const worker = new Worker('../src/router/worker.js', { workerData });
          worker.on('message', resolve);
          worker.on('error', reject);
          worker.on('exit', (code) =&gt; {
            if (code !== 0)
              reject(new Error(`Worker stopped with exit code ${code}`));
          })
        })
      }

      async function run() {
        const result = await runService('john wick')
        console.log(&quot;this is from main thread &quot; + result);
      }

      run().catch(err =&gt; console.error(err))
})
</code></pre>
<p>When I try to save the data using worker thread then I am getting this error:</p>
<pre><code>MongooseError: Operation `agents.insertOne()` buffering timed out after 10000ms
    at Timeout.setTimeout (F:\node\insuredmine\node_modules\mongoose\lib\drivers\node-mongodb-native\collection.js:184:20)
    at ontimeout (timers.js:436:11)
    at tryOnTimeout (timers.js:300:5)
    at listOnTimeout (timers.js:263:5)
    at Timer.processTimers (timers.js:223:10)
</code></pre>
<p>and when I run the same line of code without worker thread then its running fine.</p>

